Here's a simple example:

HTML:
```html
<div class="container">
  <div>Div 1</div>
  <div>Div 2</div>
  <div>Div 3</div>
</div>
```
CSS:
```css
.container {
  display: flex;
  justify-content: flex-end;
}

.container div {
  margin: 10px;
  padding: 20px;
  border: 1px solid black;
  background-color: #f9f9f9;
}
```
In this example, we have a container div that holds the row of divs. We set the display property to flex and justify-content property to flex-end to align the row of divs to the right. 

Each individual div has some styling for demonstration purposes.
